import './Home.css';
import Fundo from '../../assets/fundo.jpg';
// import { FaLaptopCode, FaMobileAlt, FaDesktop } from 'react-icons/fa';

function HomePortfolio() {
    return (
        <section className="home">
            <img src={Fundo} alt="Fundo" className="fotoFundo" />
            <div className="home-content">
                <h1>Transformando Ideias em Soluções Digitais</h1>
                <p>
                {/*    <FaLaptopCode className="icon" /> <FaMobileAlt className="icon" /> <FaDesktop className="icon" />*/}
                {/*    Desenvolvedora de Sites e Sistemas personalizados para empresas e empreendedores que desejam uma presença online moderna e eficiente.  </p>*/}

                {/*<p>*/}
                    Se você está pronto para elevar seu negócio com uma solução digital impactante, você está no lugar certo. Vamos juntos criar algo inovador e que realmente faça a diferença para o seu público.
                </p>

                <a href="#contato" className="cta-button">Solicite um Orçamento</a>
            </div>
        </section>
    );
}

export default HomePortifolio;
